import React from "react";
import { useParams } from "react-router-dom";

const EventDetail = () => {
  const params = useParams();
  return (
    <p>
      <h1>Event Detail</h1>
      <p>{params.eventId}</p>
    </p>
  );
};

export default EventDetail;
